import FinanceItem from "./components/FinanceItem";

function App() {
  const financeItems = [
    {
      id: new Date.now(),
      title: "Book",
      Date: new Date(2021, 29, 8),
      Price: 250,
      Currency: "CZK",
    },
    {
      id: new Date.now(),
      title: "Drink",
      Date: new Date(2021, 22, 8),
      Price: 120,
      Currency: "CZK",
    },
    {
      id: new Date.now(),
      title: "Mobile",
      Date: new Date(2021, 27, 7),
      Price: 19999,
      Currency: "CZK",
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <FinanceItem></FinanceItem>
      <FinanceItem></FinanceItem>
    </div>
  );
}

export default App;
